import React from "react"

import {
 View,
 Text,
 ScrollView
}from "react-native" 



import FilterNavigation from "./filterNavigation"
import FilterScreen from "./filterScreen"

class RenderFilterScreen extends React.Component{
    static navigationOptions={
        headerShown:false
    }
 



 handlenavigator=(id,source,name,price)=>{
    this.props.navigation.navigate("screen2",{
      id:id,
      source:source,
      name:name,
      price:price
    })
  }
  

  dynamicViewInsertion=()=>{
if(this.props.screenProps. onCosmeticsShown){
    return( 

        
<ScrollView>
{this.props.screenProps.cosmetics.map(( cosmetics)=>{
    return( 
    <FilterScreen key={ cosmetics.id} counters={ cosmetics} onhandlebtnchange={this.props.screenProps.onButtonChange}  onhandleAdd={this.props.screenProps.onAdd} onNavigate={this.handlenavigator}/>
    )
    })}
</ScrollView>


    )



}else if(this.props.screenProps.onClothesShown){
    return(

<ScrollView>
{this.props.screenProps.clothes.map(( clothes)=>{
    return( 
    <FilterScreen key={ clothes.id} counters={ clothes} onhandlebtnchange={this.props.screenProps.onButtonChange}  onhandleAdd={this.props.screenProps.onAdd} onNavigate={this.handlenavigator}/>
    )
    })}
</ScrollView>

   )




}else if( this.props.screenProps.onCamerasSHown){
    return(
      

              
<ScrollView>
{this.props.screenProps. cameras.map(( cameras)=>{
    return( 
    <FilterScreen key={ cameras.id} counters={ cameras} onhandlebtnchange={this.props.screenProps.onButtonChange}  onhandleAdd={this.props.screenProps.onAdd} onNavigate={this.handlenavigator}/>
    )
    })}
</ScrollView>


    )




}else{
    return(
        <View>
            <Text>No item has been added to this category so far</Text>
        </View>
    )
}
  }

  
    render(){
        return (
            <View style={{flex:1}}>
<FilterNavigation onCosmeticShown={this.props.screenProps.onhandleShowCosmetic} onClothesShown={this.props.screenProps.onhandleShowClothes} onCamerasShown={this.props.screenProps.onhandleShowCameras}/>

{this.dynamicViewInsertion()}

            </View>
        )
    }
}
export default RenderFilterScreen
